u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_ohc=DqZcxHdOdGwAX9kUvEW\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=520a4e92ab10980db99858bcc7ec25da\u0026oe=6095A7CD\u0026_nc_sid=7bff83","username":"visitvietnamofficial"},"x":0.9346405193,"y":0.0163398702}}]},"fact_check_overall_rating":null,"fact_check_information":null,"gating_info":null,"sharing_friction_info":{"should_have_sharing_friction":false,"bloks_app_url":null},"media_overlay_info":null,"media_preview":null,"owner":{"id":"2003910702","username":"dashleyworldtour"},"is_video":false,"accessibility_caption":"Photo by Travel Couple \u2661 danny+ashley in Ship \u0111\u1ed3 \u0103n \u0111\u00eam \u0110\u1ed3ng H\u1edbi HT with @dagrisa, @ash_nap, @visitvietnam, @oxalisadventure, @campinghiking, @hikingtheglobe, @visitphongnha, @in_front_of_your_eyes, @visitvietnamofficial, and @letsvisitvietnam.","edge_media_to_caption":{"edges":[{"node":{"text":"After 2 days of hiking through the largest cave in the world we reached what they call a doline, a large sucken-in area where a cave roof has collapsed. To see this virtually untouched jungle, complete with birds, wildlife, and even its own mini-weather system, inside a cave was definitely one of those once-in-a-lifetime experiences.\n.\nAnd speaking of once-in-a-lifetime... today is Ashley\u2019s birthday (and the day that we first met). Being able to experience life with you the last 9 years has truly been the most amazing almost-decade that anyone could ask for. Happy birthday, my love \ud83d\ude18"}}]},"edge_media_to_comment":{"count":159},"comments_disabled":false,"taken_at_timestamp":1559682741,"edge_liked_by":{"count":3491},"edge_media_preview_like":{"count":3491},"location":{"id":"177495049278641","has_public_page":true,"name":"Ship \u0111\u1ed3 \u0103n \u0111\u00eam \u0110\u1ed3ng H\u1edbi HT","slug":"ship-o-an-em-ong-hoi-ht"},"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/60822074_4524973321964       request_url: errUrl.indexOf('direct') >= 0 ? 'direct' : errUrl,
      response_status_code: errorInfo.statusCode || 0
    }
  }
  window.addEventListener('load', function(){
    if (window.__bufferedErrors && window.__bufferedErrors.length) {
      if (window.caches && window.caches.keys && window.caches.delete) {
        window.caches.keys().then(function(keys) {
          keys.forEach(function(key) {
            window.caches.delete(key)
          })
        })
      }
      window.__bufferedErrors.map(function(error) {
        return normalizeError(error)
      }).forEach(function(normalizedError) {
        var request = new XMLHttpRequest();
        request.open('POST', '/client_error/', true);
        request.setRequestHeader('Content-Type', 'application/json; charset=utf-8');
        request.send(JSON.stringify(normalizedError));
      })
    }
  })
}());
